import { React, useState } from "react";
import { Outlet, Link } from "react-router-dom";
import P1 from "../../img/bazaar.png";
import P2 from "../../img/direct-download-badge.png";
import P3 from "../../img/myketmarket.png";
import P4 from "../../img/snapp-pwa.png";
import P5 from "../../img/app_store.svg";

function Downloads() {
  return (
    <section className="w-full mt-[5rem]">
      <div className="w-full px-[6%] py-2">
        <LogoLinks />
      </div>
    </section>
  );
}

function LogoLinks() {
  const [pic, setpic] = useState([
    {
      Img: P1,
      To: "https://cafebazaar.ir/app/cab.snapp.passenger?referrer=appmetrica_tracking_id%3D243413381082522868&ym_tracking_id=2955507302754132907",
    },
    {
      Img: P2,
      To: "https://myket.ir/app/cab.snapp.passenger?utm_source=search-ads-gift&utm_medium=cpc&referrer=appmetrica_tracking_id%3D1181173947656399155%26ym_tracking_id%3D2599253699390593863",
    },
    {
      Img: P3,
      To: "",
    },
    {
      Img: P4,
      To: "",
    },
    {
      Img: P5,
      To: "",
    },
  ]);
  return (
    <nav className="w-full">
      <ul className="w-full flex items-center justify-between border border-red-700">
        {pic.map((val, index) => {
          return (
            <li className="flex justify-center items-center grow">
              <Link to="/mmd" target="_blank">
                <img
                  src={val.Img}
                  className="w-[160px] h-[47px]"
                  loading="eager"
                  alt=""
                />
              </Link>
            </li>
          );
        })}
      </ul>
      <Outlet />
    </nav>
  );
}
export default Downloads;
